--------------------------------------------------------
--  DDL for Procedure AAWL_2RUN
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "DWH_PERFORMANCE"."AAWL_2RUN" (p_forall_limit in integer, p_success out boolean) as

--**************************************************************************************************
--  Date:        August 2013
--  Author:      Wendy lyttle
--  Purpose:     Tests stats

--**************************************************************************************************
g_recs_read          integer       :=  0;
g_recs_updated       integer       :=  0;
g_recs_inserted      integer       :=  0;
g_recs_hospital      integer       :=  0;
g_forall_limit       integer       :=  dwh_constants.vc_forall_limit;
g_error_count        number        :=  0;
g_error_index        number        :=  0;
g_rec_out            dwh_performance.rtl_loc_item_wk_sales_index%rowtype;
g_count              number        :=  0;
g_found              boolean;
g_SQL              VARCHAR2(4000);
g_date               date          := trunc(sysdate);
g_yesterday          date          := trunc(sysdate) - 1;


l_message            sys_dwh_errlog.log_text%type;
l_module_name        sys_dwh_errlog.log_procedure_name%type    := 'AAWL_2RUN';
l_name               sys_dwh_log.log_name%type                 := dwh_constants.vc_log_name_rtl_md;
l_system_name        sys_dwh_log.log_system_name%type          := dwh_constants.vc_log_system_name_rtl_prf;
l_script_name        sys_dwh_log.log_script_name%type          := dwh_constants.vc_log_script_rtl_prf_md;
l_procedure_name     sys_dwh_log.log_procedure_name%type       := l_module_name;
l_text               sys_dwh_log.log_text%type ;
l_description        sys_dwh_log_summary.log_description%type  := 'test stats';
l_process_type       sys_dwh_log_summary.log_process_type%type := dwh_constants.vc_log_process_type_n;

-- For output arrays into bulk load forall statements --
type tbl_array_i is table of dwh_performance.rtl_loc_item_wk_sales_index%rowtype index by binary_integer;
type tbl_array_u is table of dwh_performance.rtl_loc_item_wk_sales_index%rowtype index by binary_integer;
a_tbl_insert        tbl_array_i;
a_tbl_update        tbl_array_u;
a_empty_set_i       tbl_array_i;
a_empty_set_u       tbl_array_u;
a_count             integer       := 0;
a_count_i           integer       := 0;
a_count_u           integer       := 0;
l_from_date         date := trunc(sysdate) - 1;
l_fin_year_no       number;
l_fin_week_no       number;
l_fin_year_month_no       number;
l_last_wk_start_date date;
l_last_wk_end_date    date;
l_last_wk_ly_start_date date;
l_last_wk_ly_end_date   date;

g_start_date date;

g_partition_name varchar2(40);

l_ly_fin_year_no    number;
l_ly_fin_week_no    number;

--**************************************************************************************************
-- Main process loop
--**************************************************************************************************
begin

    if p_forall_limit is not null and p_forall_limit > dwh_constants.vc_forall_minimum then
       g_forall_limit := p_forall_limit;
    end if;
    dbms_output.put_line('Bulk write limit '||p_forall_limit||' '||g_forall_limit);
    p_success := false;

    l_text := dwh_constants.vc_log_draw_line;
    dwh_log.write_log(l_name,l_system_name,l_script_name,l_procedure_name,l_text);

    l_text := 'started AT '||
    to_char(sysdate,('dd mon yyyy hh24:mi:ss'));
    dwh_log.write_log(l_name,l_system_name,l_script_name,l_procedure_name,l_text);

    dwh_log.insert_log_summary(l_name,l_system_name,l_script_name,l_procedure_name,l_description,
    l_process_type,dwh_constants.vc_log_started,'','','','','');

-- ######################################################################################### --
-- The outer joins are needed as there are cases when there are no sales in dense for items  --
-- which must be included in order to show a zero sales index as these records will be       --
-- created when the outer joins to either dense LY or the item price records are found       --
-- ######################################################################################### --

EXECUTE IMMEDIATE ('

  CREATE TABLE DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON 
   (	SK1_CHAIN_NO NUMBER(9,0) NOT NULL ENABLE, 
	SK1_GRADE_NO NUMBER(9,0) NOT NULL ENABLE, 
	SK1_STYLE_COLOUR_NO NUMBER(9,0) NOT NULL ENABLE, 
	FIN_YEAR_NO NUMBER(4,0) NOT NULL ENABLE, 
	FIN_WEEK_NO NUMBER(2,0) NOT NULL ENABLE, 
	FIN_WEEK_CODE VARCHAR2(7 BYTE) NOT NULL ENABLE, 
	REG_RSP_INCL_VAT NUMBER(14,2), 
	SALES_ACT NUMBER(14,2), 
	COST_PRICE_ACT NUMBER(14,2), 
	SELLING_RSP_ACT NUMBER(14,2), 
	CHAIN_INTAKE_MARGIN_ACT NUMBER(14,2), 
	SALES_QTY_ACT NUMBER(14,3), 
	SALES_PLANNED_QTY_PRE_ACT NUMBER(14,3), 
	TARGET_STOCK_QTY_ACT NUMBER(14,3), 
	APS_SALES_QTY_ACT NUMBER(14,3), 
	SALES_STD_ACT NUMBER(14,2), 
	SALES_MARGIN_STD_ACT NUMBER(14,2), 
	STORE_INTAKE_SELLING_STD_ACT NUMBER(14,2), 
	SALES_QTY_STD_ACT NUMBER(14,3), 
	TARGET_STOCK_QTY_STD_ACT NUMBER(14,3), 
	SALES_QTY_6WK_ACT NUMBER(14,3), 
	SALES_6WK_ACT NUMBER(14,2), 
	TARGET_STOCK_SELLING_6WK_ACT NUMBER(14,2), 
	STORE_COUNT_ACT NUMBER(4,0), 
	PROM_SALES_QTY_ACT NUMBER(14,3), 
	PROM_SALES_SELLING_ACT NUMBER(14,2), 
	CLEAR_SALES_QTY_ACT NUMBER(14,3), 
	CLEAR_SALES_SELLING_ACT NUMBER(14,2), 
	TARGET_STOCK_SELLING_ACT NUMBER(14,2), 
	REG_SALES_QTY_ACT NUMBER(14,3), 
	REG_SALES_SELLING_ACT NUMBER(14,2), 
	LAST_UPDATED_DATE DATE NOT NULL ENABLE, 
	NUM_AVAIL_DAYS_6WK_ACT NUMBER(6,0), 
	NUM_CATLG_DAYS_6WK_ACT NUMBER(6,0), 
	CHAIN_INTAKE_SELLING_ACT NUMBER(14,2), 
	CHAIN_INTAKE_SELLING_STD_ACT NUMBER(14,2), 
	CHAIN_INTAKE_MARGIN_STD_ACT NUMBER(14,2)
   )  LOGGING
  TABLESPACE PRF_MASTER 
');
COMMIT;

  EXECUTE IMMEDIATE ('ALTER TABLE DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON ADD CONSTRAINT PK_MART_CHASTCHNGRDSCWK_SEASON PRIMARY KEY (SK1_CHAIN_NO, SK1_GRADE_NO, SK1_STYLE_COLOUR_NO, FIN_YEAR_NO, FIN_WEEK_NO)
  USING INDEX 
  TABLESPACE PRF_MASTER  ENABLE');
  commit;


  EXECUTE IMMEDIATE ('CREATE INDEX DWH_PERFORMANCE.I10_MART_CHASTCHNGRDSCWK_SSN ON DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON (LAST_UPDATED_DATE) 
    TABLESPACE PRF_MASTER');
    
  EXECUTE IMMEDIATE ('CREATE OR REPLACE PUBLIC SYNONYM MART_CHASTCHNGRDSCWK_SEASON FOR DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON');
COMMIT;

    EXECUTE IMMEDIATE ('GRANT SELECT ON DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON TO READ_ONLY');
    EXECUTE IMMEDIATE ('GRANT DELETE ON DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON TO DATA_FIX_ROLE');
    EXECUTE IMMEDIATE ('GRANT INSERT ON DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON TO DATA_FIX_ROLE');
    EXECUTE IMMEDIATE ('GRANT SELECT ON DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON TO DATA_FIX_ROLE');
    EXECUTE IMMEDIATE ('GRANT UPDATE ON DWH_PERFORMANCE.MART_CHASTCHNGRDSCWK_SEASON TO DATA_FIX_ROLE');
    
